import { createAsyncThunk, createSlice } from '@reduxjs/toolkit';
import { codeCompletion } from '../services/editor.service';

const initialState = {

};

export const codeCompletionAsync = createAsyncThunk(
    'editor/codeCompletion',
    async (val, type) => {
        const response = await codeCompletion();
        return response.data;
    }
);

export const editorSlice = createSlice({
    name: 'editor',
    initialState,
    reducers: {
    },
    extraReducers: (builder) => {
        builder
            .addCase(codeCompletionAsync.fulfilled, (state, action) => {
                console.log('loaded current orders')
                state.currentOrders = action.payload;
            })
    },
});

export const {} = editorSlice.actions;

export default editorSlice.reducer;
